contracts/transact.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity <=0.8.11;
contract transact {
    mapping (address => uint) balances;
    int trans = 1;
    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    // constructor() public {
    //     balances[tx.origin] = 10000;
    // }

    function invest() external payable {
        if(msg.value < 1 ether){
            revert();
        }

    }
    function balanceOf() external view returns (uint) {
        return address(this).balance; 
    }

    function getBalanceInEth(address addr) public view returns(uint){
        return getBalance(addr);
    }

    function getBalance(address addr) public view returns(uint) {
        return balances[addr];
    }

    function Block(uint time,int transactions,uint hash, string memory previousHash )public view returns(bytes32 hashin){
        time= block.timestamp;
       transactions=trans;
       previousHash="";
       int nonce = 0;
       uint16 diffuculty;
        hashin= sha256(abi.encodePacked(time,transactions,nonce,previousHash));
        
        return(hashin);
    
    }
     function encodeInt8(int8 time) public pure returns (bytes memory) {
        return abi.encodePacked(time);
    }
    // function mine(uint diffuculty) public view{
    //     this.Block();

    // }

}

